=======

A provincial boy comes to live with his sophisticated bohemian cousin in Paris.
Through these seeming opposites, Chabrol conjures a darkly comic character
study that questions notions of good and evil, love and jealousy, and success
in the modern world.
This dagger-sharp drama won the Golden Bear at the Berlin Film Festival and
was an important early entry in the French New Wave.

